package substring

import (
	"testing"
)

func TestLongestPalindromeSubsequence(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{
			name: "",
			args: args{
				s: "a",
			},
			want: 1,
		},

		{
			name: "",
			args: args{
				s: "abaa",
			},
			want: 3,
		},

		{
			name: "",
			args: args{
				s: "cbbd",
			},
			want: 2,
		},

		{
			name: "",
			args: args{
				s: "bbbab",
			},
			want: 4,
		},

		{
			name: "",
			args: args{
				s: "",
			},
			want: 159,
		},

		{
			name: "",
			args: args{
				s: "",
			},
			want: 1000,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := LongestPalindromeSubsequence(tt.args.s); got != tt.want {
				t.Errorf("LongestPalindromeSubsequence() = %v, want %v", got, tt.want)
			}
		})
	}
}
